import React from 'react';
import Footer from '../../components/Footer';

import './styles.css';

function Home() {
  return (
    <div className="content">
      <div className="home">
        <h1>Search Devs</h1>
        <form>
          <input />
          <button>
            <img src=""></img>
          </button>
        </form>
      </div>
      <Footer />
    </div>
  );
}

export default Home;
